DROP TABLE IF EXISTS `t_order_alipay`;
CREATE TABLE `t_order_alipay`  (
  `order_no` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单号',
  `merchant_order_no` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商户家订单号',
  `order_create_time` datetime(0) NULL DEFAULT NULL COMMENT '订单创建时间',
